import React from "react";
import styled from "styled-components";

const LivroWrapper = styled.div`
  width: 90px;
  height: 150px;
  background: #DDDDDD;
`;

const Livro = () => (
    <LivroWrapper>
        <div className="thumb">
            <img src="../assets/book-cover.png" alt="Book cover"/>
        </div>
        <p className="book-name"></p>
        <p className="book-category"></p>
    </LivroWrapper>
);

export default Livro;
